import React from "react";

const Error = () => {
  return (
    <div>
      <p>Error: Page does not exist!</p>
      <a
        className="btn btn-outline-light text-center mr-2 mt-2"
        href="/categories"
      >
        Book Now
      </a>
    </div>
  );
};

export default Error;
